import Link from 'next/link';

const Navbar = () => {
  return (
    <nav>
      <div className="logo">
        <h1>Next JS Links</h1>
      </div>
      <Link href="/"><a>Home  </a></Link>
      <p></p>
      <Link href="/about"><a>Link 1 </a></Link>
      <p></p>
      <Link href="/ninjas/"><a>Link 2 </a></Link>
    </nav>
);
}

export default Navbar;
